// Create image for PDF with a data URL.
const veggiesImg = 'data:image/png;base64,';

// Create PDF document in portrait orientation, measurement in millimeters, A4 size.
let doc = new jsPDF('portrait', 'mm', 'a4');

// Get the current date and time.
const now = new Date();
const minute = String(now.getMinutes());
const hour = String(now.getHours());
const day = String(now.getDate());
const month = String(now.getMonth());
const year = String(now.getFullYear());

// Instructions for recipe.
const dressing1 = 'To create the dressing use a ratio of 2:1 of oil to acid.';
const dressing2 = 'Example: 2/3 cup oil and 1/3 cup any kind of vinegar, ';
const dressing3 = 'fresh lime juice, or fresh lemon juice.';
const instructions1 = 'Wash vegetables throughly and chop up ingredients. In a large bowl,';
const instructions2 = 'toss the salad ingredients together. Add the salad dressing, a pinch';
const instructions3 = 'of salt, and fresh ground black pepper.';

// Create variables for additional ingredients.
let item4 = "";
let item5 = "";
let item6 = "";

// Set font size.
doc.setFontSize(8);
// Set font family.
doc.setFont('Helvetica');
// Set font weight.
doc.setFontStyle('bold');
doc.text(now.toString(), 10, 10);
// Increase font size.
doc.setFontSize(36);
// Set text color.
doc.setTextColor(173, 227, 98);
doc.text('Your simple salad recipe:', 10, 30);
doc.setTextColor(0, 0, 0);
doc.setFontSize(16);
doc.setFontStyle('normal');
// doc.setTextColor(0, 0, 0);
doc.setPage(1);
// Add JPG image to PDF file.
doc.addImage(veggiesImg, 'JPG', 98, 230, 97, 55);

// Run this invoke immediate function expression as soon as page loads.
(function(){

  const ingredient1 = ['flat_leaf_kale', 'curly_leaf_kale', 'romaine_lettuce', 'spinach', 'cabbage', 'arugula', 'watercress'];
  const ingredient2 = ['bok_choy', 'fresh_corn_kernels', 'cucumbers', 'red_pepper', 'yellow_pepper', 'radish'];
  const ingredient3 = ['avocado', 'cherry_tomato', 'tomatoes', 'broccoli', 'carrots', 'radicchio', 'endive', 'dandelion'];

  const slot1 = document.getElementById('slot1');
  const slot2 = document.getElementById('slot2');
  const slot3 = document.getElementById('slot3');

  const item1 = ingredient1[Math.floor(Math.random() * ingredient1.length)];
  const item2 = ingredient2[Math.floor(Math.random() * ingredient2.length)];
  const item3 = ingredient3[Math.floor(Math.random() * ingredient3.length)];

  setTimeout(function() {
    slot1.src = 'images/' + item1 + '.png';
  }, 1000);
  setTimeout(function() {
    slot2.src = 'images/' + item2 + '.png';
  }, 2000);
  setTimeout(function() {
    slot3.src = 'images/' + item3 + '.png';
  }, 3000);

  // Salad ingredients text.
  doc.setFontSize(22);
  doc.setFontStyle('bold');
  doc.text('Ingredients:', 10, 50);
  doc.setFontStyle('normal');
  doc.setFontSize(16);
  doc.text(item1.replace(/_/g, " "), 10, 65);
  doc.text(item2.replace(/_/g, " "), 10, 75);
  doc.text(item3.replace(/_/g, " "), 10, 85);
  doc.setFontSize(22);
  doc.setFontStyle('bold');
  // Salad dressing text.
  doc.text('Dressing:', 10, 135);
  doc.setFontStyle('normal');
  doc.setFontSize(14);
  doc.text(dressing1, 10, 150);
  doc.text(dressing2, 10, 160);
  doc.text(dressing3, 10, 170);
  doc.setFontSize(22);
  doc.setFontStyle('bold');
  // Instructions.
  doc.text('Preparation:', 10, 190);
  doc.setFontStyle('normal');
  doc.setFontSize(14);
  doc.text(instructions1, 10, 205);
  doc.text(instructions2, 10, 215);
  doc.text(instructions3, 10, 225);

})();


// Add three extra ingredients for more flavor.
const addFlavor = () => {

  const extraFlavor1 = ['flax_seeds', 'walnuts', 'almonds', 'chic_peas'];
  const extraFlavor2 = ['orange_slices', 'parsley', 'feta_cheese'];
  const extraFlavor3 = ['red_onion', 'shallot', 'garlic'];

  // Clear any previously set values.
  item4 = "";
  item5 = "";
  item6 = "";

  item4 = extraFlavor1[Math.floor(Math.random() * extraFlavor1.length)];
  item5 = extraFlavor2[Math.floor(Math.random() * extraFlavor2.length)];
  item6 = extraFlavor3[Math.floor(Math.random() * extraFlavor3.length)];

  setTimeout(function() {
    document.getElementById("slot4").classList.add("fade");
    slot4.src = 'images/' + item4 + '.png';
  }, 500);
  setTimeout(function() {
    document.getElementById("slot5").classList.add("fade");
    slot5.src = 'images/' + item5 + '.png';
  }, 1000);
  setTimeout(function() {
    document.getElementById("slot6").classList.add("fade");
    slot6.src = 'images/' + item6 + '.png';
  }, 1500);

  // Display the extra ingredients.
  document.getElementById('extras').removeAttribute('class', 'hide');
  document.getElementById('extras').classList.add('slots');

  let slot4 = document.getElementById('slot4');
  let slot5 = document.getElementById('slot5');
  let slot6 = document.getElementById('slot6');

}


const downloadRecipe = () => {

  doc.setFontSize(16);
  doc.text(item4.replace(/_/g, " "), 10, 95);
  doc.text(item5.replace(/_/g, " "), 10, 105);
  doc.text(item6.replace(/_/g, " "), 10, 115);

  // Create the file name using the date.
  doc.save(`recipe-${year}-${month}-${day}-${hour}${minute}.pdf`);

}


const regenerate = () => {
  // Refresh page and get another random selection of ingredients.
  window.location.reload();

}


// END Javascript code
